import { UserAvatar } from "./components/UserAvatar";

export default function PostCard({ post }) {
  return (
    <article key={post.id}>
      <UserAvatar uid={post.uid} />
      <img src={post.image} alt={post.title} />
      <h2>{post.title}</h2>
      <p>{post.body}</p>
    </article>
  );
}
